import React from 'react'
import './clients.css'
import gsap from 'gsap'
import Observer from 'gsap/Observer'

const Client = (props) => {
    Observer.create({
        target: ".client img",
        onClick: ()=> alert("Yo")
    })

    return (
        <div className="client">
            <img src={props.img} alt="" />
        </div>
    )
}

export default Client
